    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE col2 / col1 + - + 60 NOT IN ( + col2, ( + col2 ) + - col2 / - CAST ( - col2 AS INTEGER ) );
  - name: tab2

outputs:
  - name: q9171.out
    data: |
      46	51	23
      64	77	40
      75	67	58
